        this.props.createPlan(formValues)
    }
    render()
        {
        return (<div>
            <h3>Create a Plan</h3>
            <PlanForm onSubmit={this.onSubmit}/>
        </div>);
        }
}
export default connect(null,{createPlan})(P);
